import axios from 'axios';

export function authenticatedSubmitMaxes() {
	return (dispatch) => {
		axios({
			method: 'put',
			url: 'http://localhost:3000/maxes',
			data: {
				squat: squat,
				bench: bench,
				deadlift: deadlift,
				ohp: ohp,
				powerclean: powerclean
			}
		})
			.then(maxes => {
				if (maxes) {
					dispatch ({type: 'UPDATED_MAXES_AUTHENTICATED', payload: maxes.data})
					history.push('/strength')
				}
		});
	};
};

export function unauthenticatedSubmitMaxes() {
	return (
		type: 'UPDATED_MAXES_UNAUTHENTICATED'
	)
}
